import _ from 'lodash'

// import './space.scss'
import { Space } from './spaceStyled'

class SpaceEffect extends PureComponent {

  constructor (props) {
    super(props)
    // this.excuteEffect = this.excuteEffect.bind(this)
  }

  // excuteEffect () {

