  render () {
    return (
      <div className={this.props.className || ''}>
        <Space>
          <div className="container demo">
            <div className="content">
              <div id="large-header" className="large-header">
                <canvas id="demo-canvas"></canvas>
              </div>
            </div>
          </div>
        </Space>
      </div>
    )
  }
}

export default SpaceEffect
